import React,{useState,useEffect} from "react";



const Trader = ()=>{
    const [data,setData] = useState()

    useEffect(()=>{
        fetch("/selectTr",{
            method:"GET",
            
        }).then(
            res=>res.json()
        ).then(data=>{
            console.log(data)
            setData(data)
        })
    })
        
    
    
    return (
        <div className="table-div"> 
            <button onClick={getData}>adasd</button>   
            <table>
                <thead>
                    <tr>
                        <th>trrade_id</th>
                        <th>client</th>
                        <th>instrument</th>
                        <th>quantity</th>
                        <th>direction</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <th treade_id>1</th>
                        <th client>2</th>
                        <th instrument>3</th>
                        <th quantity>4</th>
                        <th direction>5</th>
                    </tr>
                </tbody>
            </table>
        </div>
    )
}

export default Trader
